import React from 'react';
import { BiTrophy } from 'react-icons/bi';
import { VscCode } from 'react-icons/vsc';
import { BsCalendar2Event } from 'react-icons/bs';
import { CgProfile } from 'react-icons/cg';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="nav-container">
        <div className="nav-logo">
          <span className="logo-text">Codevo</span>
        </div>

        <div className="nav-links">
          <a href="#leaderboard" className="nav-link">
            <BiTrophy className="nav-icon" />
            Leaderboard
          </a>
          <a href="#question-tracker" className="nav-link">
            <VscCode className="nav-icon" />
            Question Tracker
          </a>
          <a href="#event-tracker" className="nav-link">
            <BsCalendar2Event className="nav-icon" />
            Event Tracker
          </a>
          <a href="#profile-tracker" className="nav-link">
            <CgProfile className="nav-icon" />
            Profile Tracker
          </a>
        </div>

        <div className="nav-actions">
          <button className="login-btn">Login</button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
